package operator;

public class ComparisionOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		System.out.println(a==b);//f
		System.out.println(a>=b);//f
		System.out.println(a<=b);//t 
		System.out.println(a!=b);//t
		System.out.println(a>b);//f
		System.out.println(a<b);//t
		

	}

}
